  false,\n\t\"url\": null,\n\t\"notes\": \"The Easy Permit Process allows home and
  building owners to obtain a permit to repair or replace the same or existing elements
  of a building, without making any changes to the structure of the building. Eligible
  projects include repairing or replacing drywall, flooring, fences, sheds or garages.
  This metric tracks the average number of days DOB takes to process individual Easy
  Permits, grouped by the week the permit was processed. The target process time is
  within 1.3 days. For more information about the Easy Permitting process, go to http://www.cityofchicago.org/city/en/depts/bldgs/provdrs/permit_proc.html.\",\n\t\"license_title\":
